import styled from "styled-components";

export const ContributionBox = styled.div`
  border: 1px gray solid;

  ul {
    display: flex;
    flex-direction: column;
    height: 10rem;
    display: inline-block;
  }

  li {
    display: inline-block;
    width: 10px;
    height: 10px;
    margin: 2px;
    border: 0.2px solid black;
  }
`;
